import React from 'react';
import { Link } from 'react-router-dom';
import InputControl from '../inputControl/InputControl';
import styles from "./Signup.module.css"

const Signup = () => {
  return (
    <div className={styles.container}>
        <div className={styles.innerBox}>
            <h1 className={styles.heading}>signup</h1>
            <InputControl label="Name" type = "text" placeholder ="Enter Your Name" />
            
            <InputControl label="Email" type ="email"  placeholder ="Enter Your Email" />
            <InputControl label="Password" type = "password" placeholder ="Enter Your Password" />

            <div className={styles.footer}>
                <button>signup</button>
                <p>Dont have account?</p> <span><Link to="/login">Login</Link></span>
            </div>

        </div>
    </div>

  )
}

export default Signup
